 /// @param owner The owner of the delegated wallet\n    /// @param delegates The owner of the delegated wallet\n    /// @return The delegated wallet address\n    function createWallet (address owner, address[] memory delegates) public payable returns (IDelegatedWallet) {\n        // see https://solidity.readthedocs.io/en/v0.5.0/050-breaking-changes.html?highlight=address_make_payable for converting to payable addresses\n        address payable clone = address(uint160(createClone(blueprint)));\n        DelegatedWallet wallet = DelegatedWallet(clone);\n        wallet.initialize(address(this));\n\n        for(uint i = 0; i < delegates.length; i++)\n            wallet.addDelegate(delegates[i]);\n        \n        wallet.transferOwnership(owner);\n        \n        if(msg.value > 0)\n            address(wallet).transfer(msg.value);\n\n        emit CreateWallet_event(msg.sender, owner, address(wallet));\n\n        return wallet;\n    }\n    \n    event CreateWallet_event(address indexed caller, address indexed owner, address wallet);\n    \n}\n",sourcePath:"/home/joe/Documents/github/everchain-project/delegated-wallet/contracts/DelegatedWalletFactory.sol",ast:{absolutePath:"/home/joe/Documents/github/everchain-project/delegated-wallet/contracts/DelegatedWalletFactory.sol",exportedSymbols:{DelegatedWalletFactory:[655]},id:656,nodeType:"SourceUnit",nodes:[{id:536,literals:["solidity","^","0.5",".0"],nodeType:"PragmaDirective",src:"0:23:2"},{absolutePath:"/home/joe/Documents/github/everchain-project/delegated-wallet/contracts/external/CloneFactory.sol",file:"./external/CloneFactory.sol",id:537,nodeType:"ImportDirective",scope:656,sourceUnit:1039,src:"25:37:2",symbolAliases:[],unitAlias:""},{absolutePath:"/home/joe/Documents/github/everchain-project/delegated-wallet/contracts/DelegatedWallet.sol",file:"./DelegatedWallet.sol",id:538,nodeType:"ImportDirective",scope:656,sourceUnit:535,src:"63:31:2",symbolAliases:[],unitAlias:""},{baseContracts:[{arguments:null,baseName:{contra